import React from "react";

type ItemBlock = {
  imageUrl: any;
  title: string;
  description: string;
};

const ItemBlock: React.FC = ({ imageUrl, title, description }) => {
  return (
    <div className="product">
      <img src={imageUrl} alt="" />
      <div className="desc">
        <span>{title}</span>
        <p>{description}</p>
      </div>
    </div>
  );
};

export default ItemBlock;
